진짜 매일 배달만 시켜먹으니 그지가 되는구나
이미 여기저기 다녀서 언제 감염되도 모르겠지만 최대한 외출을 자제하려고 하니 쉽지 않네 ㅡㅡ;
그렇다고 나가기엔 코로나걸릴거 같고

@KBSnews 유럽의약품청 "코로나19 백신 자료 해킹당했다"
국정원의 소행이 아닌가... 의심스럽다.
한편 나라가 디비진다. 💀국정원 해킹사건(빨간 마티즈)에 연루된 전-현직 총리들(황교안,이낙연,정세균)이 곧 체포되며 제거된다. KBS의 관심요.

